// Home.js
import React from 'react';
import { Link } from 'react-router-dom'; // Ensure Link is imported

const Home = () => {
  return (
    <main className="bg-gradient-to-br from-blue-200 to-blue-400 p-8 text-center">
      <div className="flex flex-col items-center space-y-6">
        <div className="max-w-2xl text-center">
          <h2 className="text-4xl text-blue-800 mb-4">Building modern, scalable web applications</h2>
          <p className="text-xl text-gray-700 mb-6">Welcome! I'm Mohamed Ali, a developer passionate about creating clean and efficient code. Explore my work and skills below.</p>
          <Link to="/projects" className="bg-blue-600 text-white py-2 px-6 rounded hover:bg-blue-700 transition-all duration-300">View My Work</Link>
        </div>
        <div>
          <img src="portfolio/Images/chen-Qtu3hGinLF8-unsplash.jpg" alt="Coding at Work" className="max-w-md rounded-lg shadow-xl"/>
        </div>
      </div>
    </main>
  );
};

export default Home;
